This is a collection of Jason's works in the English versions, all in digital format for the first time. You can compare these against a different collection primarily featuring scans recently posted by the esteemable gesserit here (slight overlap): &lt;a href=&quot;
http://thepiratebay.se/torrent/10392746&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://thepiratebay.se/torrent/10392746&lt;/a&gt;

The contents of this torrent are nearly all of the available comics so far, with only Athos in America (2012) yet to be scanned in any form, it seems. The full list is as follows:

Hey, Wait... (2001)
Sshhhh! (2002)
The Iron Wagon (2003)
Tell Me Something (2004)
You Can't Get There From Here (2004)
Why Are You Doing This? (2005)
Meow, Baby! (2006)
The Left Bank Gang (2006)
The Living And The Dead (2007)
I Killed Adolf Hitler (2007)
The Last Musketeer (2008)
Pocket Full of Rain (2008)
Low Moon (2009)
Werewolves of Montpellier (2010)
Isle of 100,000 Graves (2011) [with Fabien Vehlmann]
Lost Cat (2013)

ALL versions contained within are the digital copies thanks to Empire scanners. Please seed, and enjoy! 

